import './App.css';
import UrlInput from './components/UrlInput';
import ScrappedData from './components/ScrappedData';
import HiddenInput from './components/HiddenInput';

function App() {
  return (
    <div className="App">
      <div className="content">
        <UrlInput />
        <ScrappedData />
        <div className="test">
          <HiddenInput value="15" disabled={true} />
          <HiddenInput value="PLN" disabled={true} />
        </div>
      </div>
    </div>
  );
}

export default App;
